import { FiHome, FiMenu } from 'react-icons/fi';
import '../stylesheets/Header.css';

function Header() {
  const goHome = () => {
    window.location.href = '/main';
  };
  const toggleMenu = () => {
    console.log('toggle menu');
  };
  return (
    <>
      <header>
        <FiHome className="header-btn icon-btn" onClick={goHome} />
        <FiMenu className="header-btn icon-btn" onClick={toggleMenu} />
      </header>
    </>
  );
}

export default Header;
